import React from 'react';
import './AboutSection.css';

const AboutSection = () => {
  return (
    <section className="about-brick-tech">
      <div className="about-brick-tech__content">
        <div className="about-brick-tech__text">
          <h2 className="about-brick-tech__title">Brick Tech Contracting Corp</h2>
          <p className="about-brick-tech__description">
            We began Brick Tech Contracting Corp with one focus: to build a company that can compete with large construction firms while operating with the flexibility and customer-focus of a small, family-run business. We call it small business values with a big business approach.
          </p>
          <ul className="about-brick-tech__features">
            <li><span>✔</span> Reliable support</li>
            <li><span>✔</span> Guaranteed Satisfaction</li>
            <li><span>✔</span> Superior Quality</li>
          </ul>
        </div>
        <div className="about-brick-tech__image">
          <img src="./Pictures/about-brick-tech.jpg" alt="Brick Tech Contracting Corp" />
        </div>
      </div>
    </section>
  );
};

export default AboutSection;
